Today is the day that our 12 in. vinyl fabulously colored red is released into the world of Independent record stores! Cheap Fantastical Takedown is out today, I don't know if you have any memories of walking into a record store as a kid digging through the cassettes or tattered vinyl and finding some strange gem of punk rock or indie or metal that somehow changed your life and even possibly the trajectory of your world. I know that I do, I believe it was a 7-in of REM's classic Radio Free Europe found at Ranch Records in Salem Oregon probably around 91'. The store had a giant mural painted on the outside wall of I believe Bob Dylan Beethoven Jimi Hendrix and possibly Stevie Wonder. A fitting cohort. Anyway, get to your record store down the block and buy our new 12-in it's got three songs on it and a whole lot of love baked in, mixed by the incredible @djamesgoodwin recorded by the indubitable @n8vanderpool !!! Released by the amazing @yeproc

